(72347, 'D0557640-B917-4BDC-AF31-3D16067DB8C1', 'Yes, I am sharing with you.  And perhaps I need some help on clarity here. My understanding is when I am meeting someone for the first time that there aren’t restrictions, and that i need to share with you, versus get permission…and that you are doing the same….you told me that you planned a coffee date with Josh…and that you are going to explore whether there might be some potential. ', 'David', 'Nitzan', '2023-09-29T11:26:13.830424'),
(72348, '00E9B0D0-F5A3-4914-86B2-3F359BF5D776', 'I️ think we had several conversations where I️ said that I️ wanted to be asked even for first dates. Remember when I️ found in your phone that you met up with someone without sharing and I️ thought you weren’t be transparent. ', 'Nitzan', 'David', '2023-09-29T11:42:25.139693'),
