(72351, '43F9968E-6FE2-4113-8FA9-6B7AD0DE8F72', 'I️ know you have made the distinction between someone you don’t know if there is chemistry or not. But in my mind, I️ would like to know about every meet up regardless of whether you know if there is something there or not. And I️ thought we had landed on “Asking” for a yes, not telling. ', 'Nitzan', 'David', '2023-09-29T11:48:46.193250'),
